from typing import List
import random 

class Solution:
  def kthLargestNumber(self, nums: List[str], k: int) -> str:
    def quickSelect(nums, s, e, k):
      # random.shuffle(nums)
      while s <= e:
        partitionIndex = partition(nums, s, e)
        if partitionIndex == len(nums) - k:
          return nums[partitionIndex]
        elif partitionIndex < len(nums) - k:
          s = partitionIndex + 1
        else:
          e = partitionIndex - 1
    def partition(nums, s, e):
      # print(f'random {random.randint(s, e)}')
      pivot = int(nums[((e - s) // 2)]) #random.randint(s, e)
      partitionIndex = s
      for j in range(s, e):
        if int(nums[j]) < pivot:
          swap(nums, j, partitionIndex)
          partitionIndex += 1
      swap(nums, partitionIndex, e)
      return partitionIndex
    def swap(nums, i, j):
      tmp = nums[i]
      nums[i] = nums[j]
      nums[j] = tmp
    res = quickSelect(nums, 0, len(nums) - 1, k)
    # print(f'{res}')
    return res

